import React, { Component } from 'react';
import TaskDoingList from './../Components/TaskDoingList'
import TaskFinishList from './../Components/TaskFinishList' 
class TaskPage extends Component {
    render() {
        return (

                 <div className="container">
        <div className="page-header">
          <h1>Project 05 - Bug Reporting <small>React Redux Router Firebase</small></h1>
        </div>
        <div className="row">
          <div className="col-xs-2 col-sm-2 col-md-2 col-lg-2">
            <div className="list-group"><a className="list-group-item active active" aria-current="true" href="/task">Task</a><a className="list-group-item " aria-current="false" href="/user">User</a></div>
          </div>
          <div className="col-xs-10 col-sm-10 col-md-10 col-lg-10">
            <div className="row">
              <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6">
               <TaskDoingList/>
              <div className="col-xs-6 col-sm-6 col-md-6 col-lg-6">
               <TaskFinishList/>
              </div>
            </div>
          </div>
        </div>
      </div>
            </div>
        );
    }
}

export default TaskPage;
